const Header = () => {
  return (
    <tr style={{ fontWeight: 'bold', color: 'red'}}>
        <td> Name </td>
        <td> Price </td>
        <td style={{ paddingLeft: 50}}>Stock </td>
    </tr>
  )
}

export default Header
